import './App.css';
import NewItem from './NewItem.js'
import ThingsToDo from './ThingsToDo.js'


function App() {
  return (
    <div className="App">
      <header className="App-header">
        To Do List
      </header>
      <NewItem />
      <ThingsToDo />
      <footer>
        There will also be a footer!
      </footer>

    </div>
  );
}

export default App;
